      tinNhan:'lam bai tap chua',
      soTNChuaDoc: 3
    },
  ])
  return (
    <View style={{
      flex: 1
    }}>
      <View>
        <Text>Huynh Quoc Hao</Text>
      </View>
    </View>
  );
};

export default ChatList;
